import React, { Component } from "react";
import axios from "axios";

class Silkum extends Component {
  componentDidMount() {}

  List() {
    axios
      .get("http://seeho.kro.kr:3010/json")
      .then(function(res) {
        return res.data.map((data, i) => (
            <div className="container">
                hi
                {console.log('dd',i)}
            </div>
        ))
      })
      .catch(function(err) {
        console.log(err);
      });
  }
  render() {
    return (
      <>
        <div>
        {this.List()}
        </div>
      </>
    );
  }
}

export default Silkum;
